import "./table.css"
import { useState } from 'react'
import React, { Component } from 'react'

export class Table extends Component {
    var 
    tableData = [
        {
            id: 1,
            name: 'Tim',
            age: 25,
        },
        {
            id: 2,
            name: 'Jane',
            age: 22,
        },
    ]
    render() {
        return (
            <div className="table-container">
                <table tableData={this.tableData} className="quote-table">
                    <th>
                        <td>Quote Date</td>
                        <td>Gallons</td>
                        <td>Delivery Date</td>
                        <td>PPG</td>
                        <td>Total</td>
                    </th>
                </table>
            </div>
        )
    }
}

export default Table
